import React from "react";
import styled from "styled-components";
import image from "../img/logo.png"
import HomeIcon from "@mui/icons-material/Home"; 

const Container = styled.div`
flex:1;
background-color:#202020;
height:200vh;
color:white;
font-size:14px
`;



const Wrapper = styled.div`
padding: 18px 26px

`

const Logo = styled.div`
  display:flex;
  align-items: center;
  gap: 5px;
  font-weight: bold;
  margin-bottom: 25px;
   
`;

const Img= styled.img`
height: 25px;
`

const  Item = styled.div`
    display: flex;
    align-items: center;
    gap:20px;
    cursor:pointer;
    padding: 7.5px 0px 
`


const Menu =()=>{
    return (
      <Container>
        <Wrapper>
          <Logo>
            <Img src={image} />
            Stream.io
          </Logo>
          <Item>
            <HomeIcon />
            Home
          </Item>
          <Item>
            <ExploreOutlinedIcon />
            Explore
          </Item>
          <Item>
            <SubscriptionsOutlinedIcon />
            Subscriptions
          </Item>
          <Hr />
          <Item>
            <VideoLibraryOutlinedIcon />
            Library
          </Item>
          <Item>
            <HistoryOutlinedIcon />
            History
          </Item>
          <Hr />
          <Login>
            Sign in to like videos, comment, and subscribe.
            <Link to="signin" style={{ textDecoration: "none" }}>
              <Button>
                <AccountCircleOutlinedIcon />
                SIGN IN
              </Button>
            </Link>
          </Login>
        </Wrapper>
      </Container>
    );
}


export default Menu
